style.css:
@-moz-document domain("jquery.com") {
/* Site Settings */

* {
	letter-spacing: 1px!important;	
	text-decoration: none!important;
	transition: none!important;
}

selector
{
	text-transform: capitalize!important;
}

#content .signatures,

.entry-wrapper,

footer .books li a:hover img,
:focus
{
	border: none!important;
	box-shadow: none!important;
	outline: none!important;
    text-shadow: none!important;
}

/*___ Fonts ________________________________________________________________________*/

selector
{
	font-size: 31px!important;
}

body
{
	font-size: 1.2em!important;
}

#content .signature h4 a,

.syntaxhighlighter a,
.syntaxhighlighter code,
.syntaxhighlighter div,
.syntaxhighlighter pre,
.syntaxhighlighter table caption,
.syntaxhighlighter table tbody,
.syntaxhighlighter table td,
.syntaxhighlighter table thead,
.syntaxhighlighter table tr,
.syntaxhighlighter table,
.syntaxhighlighter textarea,

li code,
p code,
tbody code 
{
    font-size: 1.3rem!important;
}

selector
{
	font-size: .9em!important;
}

#banner-secondary .features-box p,

xxx {
    line-height: 1.2em;
}

.syntaxhighlighter a,
.syntaxhighlighter code,
.syntaxhighlighter div,
.syntaxhighlighter pre,
.syntaxhighlighter table caption,
.syntaxhighlighter table tbody,
.syntaxhighlighter table td,
.syntaxhighlighter table thead,
.syntaxhighlighter table tr,
.syntaxhighlighter table,
.syntaxhighlighter textarea
{
	line-height: 2rem!important;
}

#content ul li,
body
{
	line-height: 1.5rem!important;
}

/*___ Remove Items _________________________________________________________________*/

selector
{
	left: -9999px!important;
	position: absolute!important;
	top: -9999px!important;
}

/*___ Left/Right/Top/Bottom ________________________________________________________*/

.push-eight {
    left: 68%!important;
}

/*___ Margins ______________________________________________________________________*/

#banner-secondary,

.center-txt,
.entry-wrapper,
.row .twelve,
.twelve
{
    margin: 1rem!important;
}

selector
{
	margin: 12px!important;
}

#content .signatures li div
{
	margin: 13px 6px!important;
}

.row .row {
    margin: 0 14px!important;
}

/*___ Paddings _____________________________________________________________________*/

#banner-secondary,

.row .twelve,
.twelve
{
    padding: 1rem!important;
}

selector
{
	padding: 12px!important;
}

selector
{
	padding: 3px 26px!important;
}

/*___ Heights ______________________________________________________________________*/

selector
{
	max-height: none!important;
}

selector
{
	height: auto!important;
}

/*___ Widths _______________________________________________________________________*/

#content .signatures,
.constrain,
.row
{
	max-width: none!important;
}

#sidebar, .sidebar-left, .sidebar-right
{
	width: auto!important;
}

#content,

.row
{
	width: 100%!important;
}

selector
{
	width: 45%!important;
}

}

@-moz-document domain("jquery.com") {
/* Media Query */

@media (min-width: 1921px) and (max-width: 2560px) {
	
	.content-right #content {
    width: 82%!important;
}
	
	.features-box.row.eight.columns.pull-four {
    width: 67%!important;
}
	
	.four, .row .four {
    width: 31%!important;
}
	
}

@media (min-width: 1080px) and (max-width: 1920px) {
		
	.content-right #content {
    width: 76%!important;
}
	
	.features-box.row.eight.columns.pull-four {
    width: 67%!important;
}
	
	.four, .row .four {
    width: 29%!important;
}
	
}
}

@-moz-document domain("jquery.com") {
/* Font Settings */

a[href]
{
	color: #0ff!important;
	text-shadow: 1px 1px #000!important;
}

a[href]:visited
{
	color: #fc79fc!important;
	text-shadow: 1px 1px #000!important;
}

/*__________________________________________________________________________________*/

a[href]:hover,
h1,
input[type="checkbox"]:checked+label,
input[type="radio"]:checked+label
 {
	color: #ff0!important;
}

/*__________________________________________________________________________________*/

.entry-content p,
body,
li
 {
	color: #fff!important;
}

/*___ Khaki ________________________________________________________________________*/

h1,
h2,
p code,
ul strong
 {
	color: #F0E890!important;
}

/*___ Burlywood ____________________________________________________________________*/

#content th code,
.entry-wrapper strong,

h3,
h4
 {
	color: #e0b880!important;
}

/*___ Sandy Brown __________________________________________________________________*/

.desc strong,
.entry-meta,

h5,
h6,
label
 {
	color: #F0A060!important;
}

/*___ Blue _________________________________________________________________________*/

time
 {
	color: #07beff!important;
}

/*___ Green ________________________________________________________________________*/

selector
 {
	color: #07ff24!important;
}

/*___ Red __________________________________________________________________________*/

em,
i
 {
	color: #ff0707!important;
}

/*__________________________________________________________________________________*/

input,
input[type=email],
input[type=number],
input[type=password],
input[type=search],
input[type=tel],
input[type=text],
select,
textarea
{
	background-color: #5d1b1b!important;
	color: #fff!important;
}

/*__________________________________________________________________________________*/

::selection
{
	background: #ff9!important;
	color: #000!important;
}

pre ::selection
{
	background: #ff9!important;
	color: #000!important;
}

::placeholder
{
	color: #f48f8f!important;
	opacity: 1;
}

/*___ Misc _________________________________________________________________________*/

code
{
	color: #fff!important;
}

pre .keyword, pre .hljs-keyword, pre .css .rule .keyword, pre .css .hljs-keyword, pre .winutils, pre .javascript .title, pre .javascript .hljs-name, pre .nginx .title, pre .nginx .hljs-name, pre .subst, pre .hljs-subst, pre .request, pre .status {
    color: #fff990;
}

pre .attribute, pre .hljs-attribute, pre .hljs-attr, pre .variable, pre .hljs-variable, pre .lisp .body, pre .lisp .hljs-symbol {
    color: #06ffff;
}

pre .comment, pre .hljs-comment, pre .template_comment, pre .diff .header, pre .diff .hljs-meta, pre .javadoc, pre .hljs-doctag {
    color: #b4b4b4;
}

pre .tag, pre .hljs-tag, pre .tag .title, pre .hljs-tag .hljs-name, pre .rules .property, pre .django .tag .keyword, pre .django .hljs-tag .hljs-keyword {
    color: #5252ff;
	font-weight: 900;
}

pre .class, pre .hljs-selector-class {
    color: #84a3ff;
}

pre .number, pre .hexcolor, pre .hljs-number, pre .ruby .constant {
    color: #d2ff00;
}

pre .built_in, pre .hljs-built_in, pre .lisp .title, pre .lisp .hljs-name, pre .clojure .built_in, pre .clojure .hljs-built_in {
    color: #00bfff;
}












}

